import React from 'react';
import { BrowserRouter as Route, Routes, Switch} from 'react-router-dom';
import Client from './components/Client';
import TicketList from './components/Admin';
//import TicketRespond from './components/TicketRespond';

function App() {
  return (
// Assume that anyone landing on this page is a user & admin will access at <url>/admin
<Routes>
    <Route path="/client">
        <Client />
    </Route>
    <Route path="/">
        <Client />
    </Route>
    <Route path="/admin">
        <TicketList />
    </Route>
</Routes>
  );
};

export default App;
